import UIKit
import Foundation

class CartListRouter: BaseRouter {
    
    // MARK: - Private properties
    private let storyboard = UIStoryboard(name: "CartList", bundle: nil)
    
    // MARK: Module Setup
    init() {
        let moduleViewController = storyboard.instantiateViewController(ofType: CartListViewController.self)
        super.init(viewController: moduleViewController)
        let interactor = CartListInteractor()
        let presenter = CartListPresenter(view: moduleViewController, interactor: interactor, router: self)
        moduleViewController.presenter = presenter
        interactor.presenter = presenter
    }
    
}

